import React from "react";

export default class GameCard extends React.Component{
    constructor(){
        super()
        this.state={
            games:[],
            loading: false,
            error: null
        }
    }

    fetchData(){
        fetch("../../../public/kinds-of-games.json")
            .then(resp=>resp.json)
            .then(resp=>
               this.setState({
                    games: resp
               })) 
            .catch(error=>this.setState({
                error
            })) 


    }
    render(){
        return(
            <div>
                {this.state.error?<p>Error Occured</p>:null}

                <tittle>Game card</tittle>
                <p>{this.state.games.kindName}</p>


            </div>
        )
    }
}
